func TestMain(t *testing.T) {

	args := []struct {
		name string
		f    func(string, int) int
		s    string
		k    int
		want int
	}{
		{
			name: "one",
			f:    takeCharacters,
			s:    "aabaaaacaabc",
			k:    2,
			want: 8,
		}, {
			name: "two",
			f:    takeCharacters,
			s:    "a",
			k:    1,
			want: -1,
		}, {
			name: "three",
			f:    takeCharactersClaude,
			s:    "",
			k:    32701,
			want: -1,
		},
		//  
		// {
		// 	name: "three",
		// 	f:    takeCharacters,
		// 	s:    "",
		// 	k:    32701,
		// 	want: -1,
		// },
	}

	for _, v := range args {

		t.Run(v.name, func(t *testing.T) {
			if got := v.f(v.s, v.k); got != v.want {
				t.Errorf(" got: %v   want: %v", got, v.want)
			}
		})

	}

}

func takeCharacters(s string, k int) int {
	// a -> 1 b -> 2 c -> 3

	if k == 0 {
		return 0
	}

	var bfs func(distance int) int
	bfs = func(distance int) int {
		// 
		if distance > len(s) {
			return -1
		}
		idxL := distance
		idxR := 0
		// 
		for idxL >= 0 {
			charCount := []int{k, k, k}

			// log.Printf("charCount  %v \n", charCount)
			for _, v := range s[:idxL] {
				// log.Printf("idxL  %d \n", i)
				charCount[v-'a']--
			}

			for _, v := range s[len(s)-idxR:] {
				// log.Printf("idxR  i  %d v %v \n", i, v-'a')
				charCount[v-'a']--
			}
			// charCount 

			// log.Printf("charCount  %v \n", charCount)
			sum := 0
			for _, v := range charCount {
				//    charCount [-1 1 0]
				if v > 0 {
					sum += v
				}
			}
			if sum == 0 {
				//log.Printf("charCount %v \n", charCount)
				//log.Printf("idxL %d  idxR  %d \n", idxL, idxR)
				return distance
			}

			// 
			idxL--
			idxR++
		}

		return bfs(distance + 1)
	}

	return bfs(1)
}

func takeCharactersClaude(s string, k int) int {
	count := [3]int{}
	n := len(s)

	// 
	for i := 0; i < n; i++ {
		count[s[i]-'a']++
	}

	// 
	for i := 0; i < 3; i++ {
		if count[i] < k {
			return -1
		}
	}

	// 
	left, maxLen := 0, 0
	for right := 0; right < n; right++ {
		count[s[right]-'a']--
		for count[s[right]-'a'] < k {
			count[s[left]-'a']++
			left++
		}
		maxLen = max(maxLen, right-left+1)
	}

	// 
	return n - maxLen
}

func max(a, b int) int {
	if a > b {
		return a
	}
	return b
}

