func lengthOfLongestSubstring(s string) int {
    charIndex := make(map[byte]int)
    maxLength, start := 0, 0

    for end := 0; end < len(s); end++ {
        if idx, found := charIndex[s[end]]; found && idx >= start {
            start = idx + 1
        }
        charIndex[s[end]] = end
        maxLength = max(maxLength, end - start + 1)
    }

    return maxLength
}
